import React from "react";
import { BrowserRouter,Routes,Navegate,Route } from "react-router-dom";
import Estatistica from "../Estatistica/Estatisticas"


const Twitter=()=>{
	return(
		<BrowserRouter>
		  <Routes>
			<Route path="/" element={<Estatistica/>}/>
		  </Routes>
		</BrowserRouter>
	)
}
export default Twitter
